import React, { useEffect, useState } from 'react';
import { Container, Card } from 'react-bootstrap';

const Debug = () => {
  const [userData, setUserData] = useState(null);
  const [token, setToken] = useState(null);

  useEffect(() => {
    // Get and parse user data from localStorage
    const storedUser = localStorage.getItem('user');
    const storedToken = localStorage.getItem('jwtToken');

    if (storedUser) {
      try {
        const parsedUser = JSON.parse(storedUser);
        setUserData(parsedUser);
      } catch (e) {
        console.error('Error parsing user data', e);
        setUserData({ error: 'Invalid JSON in localStorage' });
      }
    }

    if (storedToken) {
      setToken(storedToken.substring(0, 20) + '...');
    }
  }, []);

  return (
    <Container className="mt-5">
      <h1>Debug Information</h1>

      <Card className="mb-4">
        <Card.Header as="h5">User Information</Card.Header>
        <Card.Body>
          {userData ? (
            <pre>{JSON.stringify(userData, null, 2)}</pre>
          ) : (
            <p>No user data in localStorage</p>
          )}
        </Card.Body>
      </Card>

      <Card className="mb-4">
        <Card.Header as="h5">JWT Token</Card.Header>
        <Card.Body>
          {token ? (
            <p>{token}</p>
          ) : (
            <p>No token in localStorage</p>
          )}
        </Card.Body>
      </Card>

      <Card>
        <Card.Header as="h5">Current Location</Card.Header>
        <Card.Body>
          <p>Current Path: {window.location.pathname}</p>
          <p>Expected Format: /logged_in/[role]/[id]</p>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default Debug;
